import React, { ReactElement } from "react";
import styled from "styled-components/native";
import { View, H1, TextInput, Button, Text } from "../../styles";
import { FontAwesome } from "@expo/vector-icons";

const HomeDiv = styled(View)`
  flex: 1;
`;

const HomeTop = styled(View)`
  background-color: #fff;
  height: 50px;
  margin: 20px;
  flex-direction: row;
  border: 2px;
  border-color: #fefefe;
`;

const HomeList = styled(View)`
  background-color: #eee;
  flex: 1;
  padding-top: 10px;
`;

const HomeBottom = styled(View)`
  background-color: #ccc;
  height: 60px;
`;

const SearchBar = styled(TextInput)`
  background-color: #333;
  height: 100%;
  flex: 1;
  color: #fefefe;
  font-size: 1.5rem;
  padding: 5px;
`;

const HomeCard = styled(View)`
  background-color: #333;
  border-radius: 5px;
  height: 60px;
  margin-top: 10px;
  margin-bottom: 10px;
  margin-left: 20px;
  margin-right: 20px;
`;

export default function Home(): ReactElement {
  return (
    <HomeDiv>
      <HomeTop>
        <FontAwesome.Button
          name="search"
          size={32}
          color="#fefefe"
          backgroundColor="#333"
        />
        <SearchBar placeholder="Search" />
      </HomeTop>
      <HomeList>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
        <HomeCard></HomeCard>
      </HomeList>
      <HomeBottom></HomeBottom>
    </HomeDiv>
  );
}
